import React, { Component } from "react";
import Request from "../helpers/requests.js";


class NewBookingContainer extends Component {
  constructor(props) {
    super(props)
    this.state = {
      tableNum: props.id,
      customers: []
    }
  }

  componentWillMount() {
    const request = new Request();
    request.get('http://localhost:8080/customers')
      .then(res => {
        this.setState({customers: res._embedded.customers})
      })
  }

  render() {
    return (
      <div>
        <form>
          <h3>New booking time</h3>
          <p> Table id: {this.state.tableNum}</p>
        </form>
      </div>
    )
  }
}

export default NewBookingContainer;
